INSERT INTO `ai_develoment_scopes` VALUES (1,'Generative AI','Generative AI is great for boosting productivity and creativity when working on new content, designs, or ideas. Andersen\'s ML enginers leverage vast amounts of data to generate original and innovative outputs.','2024-01-26 11:45:42.506000','2024-01-26 13:20:15.625000','2024-01-26 11:47:40.602000',1,1,'en'),(2,'الذكاء الاصطناعي التوليدي','يعد الذكاء الاصطناعي التوليدي أمرًا رائعًا لتعزيز الإنتاجية والإبداع عند العمل على محتوى أو تصميمات أو أفكار جديدة. يستفيد مهندسو تعلم الآلة في Andersen من كميات هائلة من البيانات لإنشاء مخرجات أصلية ومبتكرة.','2024-01-26 11:46:26.193000','2024-01-26 13:20:39.888000','2024-01-26 11:47:49.121000',1,1,'ar'),(3,'Natural Language Processing','Andersen\'s NLP projects enable computers to efficiently handle extensive volumes of human language in voice or text formats through all stages, from processing to analysis.','2024-01-26 13:21:20.016000','2024-01-26 13:21:40.583000','2024-01-26 13:21:21.668000',1,1,'en'),(4,'معالجة اللغة الطبيعية','تتيح مشاريع البرمجة اللغوية العصبية الخاصة بشركة Andersen لأجهزة الكمبيوتر التعامل بكفاءة مع كميات كبيرة من اللغة البشرية بتنسيقات صوتية أو نصية خلال جميع المراحل، بدءًا من المعالجة ووصولاً إلى التحليل.','2024-01-26 13:21:40.546000','2024-01-26 13:22:53.261000','2024-01-26 13:22:53.254000',1,1,'ar'),(5,'Advanced Data Analytics','Andersen will help you identify trends and extract valuable insights faster, make data-driven decisions, and optimize processes via intelligent forecasting, pattern recognition, and scalable programs.','2024-01-26 13:21:59.704000','2024-01-26 13:22:42.261000','2024-01-26 13:22:03.756000',1,1,'en'),(6,'تحليلات البيانات المتقدمة','سيساعدك ذلك على تحديد الاتجاهات واستخراج رؤى قيمة بشكل أسرع، واتخاذ قرارات تعتمد على البيانات، وتحسين العمليات من خلال التنبؤ الذكي، والتعرف على الأنماط، والبرامج القابلة للتطوير.','2024-01-26 13:22:42.221000','2024-01-26 13:22:44.491000','2024-01-26 13:22:44.480000',1,1,'ar'),(7,'رؤية الكمبيوتر','يستخدم المهندسون التعلم الآلي والتعلم العميق لإنشاء خوارزميات ذكية للتعرف على الكائنات وتصنيف الصور وتتبع الفيديو وما إلى ذلك.','2024-01-26 13:23:09.627000','2024-01-26 13:24:32.392000','2024-01-26 13:24:32.385000',1,1,'ar'),(8,'Computer Vision','Andersen\'s engineers use ML and Deep Learning to create smart algorithms for object recognition, image classification, video tracking, etc.','2024-01-26 13:23:22.649000','2024-01-26 13:23:24.442000','2024-01-26 13:23:24.433000',1,1,'en'),(9,'Speech Recognition','Speech Recognition reduces repetitive tasks, saving money and time by automating and accelerating processes. Andersen combines voice recognition technologies with conversational AI for the best solutions.','2024-01-26 13:24:49.414000','2024-01-26 13:25:26.140000','2024-01-26 13:24:51.467000',1,1,'en'),(10,'التعرف على الكلام','تعمل ميزة التعرف على الكلام على تقليل المهام المتكررة، مما يوفر المال والوقت من خلال أتمتة العمليات وتسريعها. فهو يجمع بين تقنيات التعرف على الصوت والذكاء الاصطناعي للمحادثة للحصول على أفضل الحلول.','2024-01-26 13:25:26.110000','2024-01-26 13:25:28.355000','2024-01-26 13:25:28.348000',1,1,'ar'),(11,'الروبوتات والأنظمة الذاتية','ستمكن حلول RPA المستخدمين النهائيين لديك من أتمتة مهامهم وبناء العمليات التي يمكنها تعلم وتنفيذ العمليات التجارية القائمة على القواعد.','2024-01-26 13:25:44.297000','2024-01-26 13:27:00.458000','2024-01-26 13:25:47.311000',1,1,'ar'),(12,'Robotics and Autonomous Systems','Andersen\'s RPA solutions will enable your end-users to automate their tasks and build processes that can learn and execute rules-based business operations.','2024-01-26 13:25:58.474000','2024-01-26 13:26:00.106000','2024-01-26 13:26:00.098000',1,1,'en');
