INSERT INTO `andersen_s_advantages` VALUES (1,'Multi-industry track record','[{\"type\": \"paragraph\", \"children\": [{\"text\": \"Andersen\'s portfolio of delivered IT projects includes over 1,000 successful tech initiatives in the most demanding and data-driven sectors.\", \"type\": \"text\"}]}]','2024-01-26 13:48:26.984000','2024-01-26 13:49:05.282000','2024-01-26 13:48:29.032000',1,1,'en'),(2,'سجل حافل للصناعات المتعددة','[{\"type\": \"paragraph\", \"children\": [{\"text\": \"تتضمن محفظة أندرسنمن مشاريع تكنولوجيا المعلومات المقدمة أكثر من 1000 مبادرة تقنية ناجحة في القطاعات الأكثر تطلبًا والتي تعتمد على البيانات.\", \"type\": \"text\"}]}]','2024-01-26 13:49:05.230000','2024-01-26 14:12:33.897000','2024-01-26 13:49:07.073000',1,1,'ar'),(3,'Worldwide reach','[{\"type\": \"paragraph\", \"children\": [{\"text\": \"Owing to multiple R&D centers and globally distributed IT staff, we are in the right position to help customers from any country.\", \"type\": \"text\"}]}]','2024-01-26 13:49:25.941000','2024-01-26 13:49:47.568000','2024-01-26 13:49:27.657000',1,1,'en'),(4,'الوصول إلى جميع أنحاء العالم','[{\"type\": \"paragraph\", \"children\": [{\"text\": \"ونظرًا لمراكز البحث والتطوير المتعددة وموظفي تكنولوجيا المعلومات الموزعين عالميًا، فإننا في المكان المناسب لمساعدة العملاء من أي بلد.\", \"type\": \"text\"}]}]','2024-01-26 13:49:47.524000','2024-01-26 13:49:49.396000','2024-01-26 13:49:49.384000',1,1,'ar'),(5,'Extensive IT talent pool','[{\"type\": \"paragraph\", \"children\": [{\"text\": \"Andersen employs over 3,500 tech experts – including developers, architects, data scientists, DevOps engineers etc. – who are ready to deliver IT projects of any scope and complexity.\", \"type\": \"text\"}]}]','2024-01-26 13:50:08.508000','2024-01-26 13:51:34.995000','2024-01-26 13:50:12.025000',1,1,'en'),(6,'مجموعة واسعة من المواهب في مجال تكنولوجيا المعلومات','[{\"type\": \"paragraph\", \"children\": [{\"text\": \"توظف  أندرسن أكثر من 3500 خبير تقني - بما في ذلك المطورين والمهندسين المعماريين وعلماء البيانات ومهندسي ديف أوبس وما إلى ذلك - المستعدين لتقديم مشاريع تكنولوجيا المعلومات بأي نطاق وتعقيد.\", \"type\": \"text\"}]}]','2024-01-26 13:51:34.942000','2024-01-26 14:13:33.364000','2024-01-26 13:51:36.643000',1,1,'ar'),(7,'High customer satisfaction rates','[{\"type\": \"paragraph\", \"children\": [{\"text\": \"The overwhelming majority of our customers – 98% – are totally content with the results we deliver, stay with us, and refer us to their partners and peers.\", \"type\": \"text\"}]}]','2024-01-26 13:52:01.178000','2024-01-26 13:52:23.595000','2024-01-26 13:52:02.852000',1,1,'en'),(8,'معدلات رضا العملاء عالية','[{\"type\": \"paragraph\", \"children\": [{\"text\": \"الغالبية العظمى من عملائنا - 98% - راضون تمامًا عن النتائج التي نقدمها، ويبقون معنا، ويحيلوننا إلى شركائهم وأقرانهم.\", \"type\": \"text\"}]}]','2024-01-26 13:52:23.560000','2024-01-26 13:52:25.726000','2024-01-26 13:52:25.714000',1,1,'ar');
